import React, { useState } from "react";
import './navigation-panel.scss';

function Navigation() {

    const [NavList, setNavlist] = useState(false);
    const showNavlist = () => setNavlist(!NavList);
    return (
        <div className={NavList ? 'Navlist active' : 'Navlist'}>
            <button className="hamburger" type="button" onClick={showNavlist}>
                <div></div>
            </button>

            <ul id='nav-list' onMouseOver={{showNavlist}}>
                <li>
                    <span class="nav-text">
                        Dashboard
                    </span>
                </li>
                <li>
                    <span class="nav-text">
                        Fleets
                    </span>
                </li>
                <li>
                    <span class="nav-text">
                        Clusters
                    </span>
                </li>
            </ul>
        </div>
    );
}

export default Navigation;
